import {Link} from 'react-router-dom';
import React from 'react';
import './Nav.css';

//로고 이미지 파일 경로
import logoImage from './logo.png';

function Nav() {
  return (
    <div>
      <div className="navbar">
        {/* 로고 이미지를 추가 */}
        <img src={logoImage} alt="Logo" className="navbarLogo" />

        {/* 선을 추가 */}
        <hr className="navbarLine" />

        {/* 메뉴들 */}
        <Link className="navbarMenu" to={'/'}>Main</Link>
        <Link className="navbarMenu" to={'/login'}>Login</Link>
        <Link className="navbarMenu" to={'/contact'}>Contact</Link>
      </div>
    </div>
  )
}

export default Nav;
